import UserData from './components/UserData';

import React, { useEffect, useState } from 'react';

function App() {


  let url = 'https://geektrust.s3-ap-southeast-1.amazonaws.com/adminui-problem/members.json';


  const [fetchedData, setUserDetails] = useState();

  useEffect(() => {

    const fetchUsers = async () => {
      try {
        fetch(url)
          .then(response => {
            return response.json();
          })
          .then(data => {
            console.log(data)
            setUserDetails(data);
          });
      } catch (error) {
        console.log(error);

      }
    }
    fetchUsers();
  }, []
  )
  // console.log(fetchedData);


  return (
    <div>
      <input type='text' className='searchBox' placeholder="Search" />
      {/* <UserData items={fetchedData}></UserData> */}
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Role</th>

          </tr>
        </thead>
        {fetchedData.map((user) => (
          <tbody>
            <tr>
              <td>{user.name}</td>
              <td>{user.email}</td>
              <td>{user.role}</td>
            </tr>
          </tbody>
        ))}
        {/* {props.items.map((user) => (
                    <SpecificUSerData
                        key={user.id}
                        name={user.name}
                        email={user.email}
                        role={user.role}
                    />

                ))} */}
      </table>


    </div>
  );
}

export default App;
